import Button from './Button'

const Header = ({ title, onAdd, showAdd }) => {
  return (
    <header className='header'>
      <h1>{title}</h1>
      <Button color='green' text='Add' onClick={onAdd}/>
    </header>
  )
}

Header.defaultProps = {
    title: 'Task Tracker',
}

